import React, { useState } from "react";

const SelectOption = () => {
    return (
        <select>
            <option>최신순</option>
            <option>오래된순</option>
        </select>
    );
};
const DiaryList = ({ diaryList }) => {
    console.log(diaryList);
    return (
        <div>
            <SelectOption />
            {diaryList.map((it) => {
                return <div key={it.id}>{it.content}</div>;
            })}
        </div>
    );
};

export default DiaryList;
